import React from 'react'

import { useFormik } from 'formik'

import {
    Button,
    Radio,
    RadioGroup,
    FormControlLabel,
    FormControl,
    FormLabel,
    InputLabel,
    MenuItem,
    Select
} from '@mui/material'

const SomeQuestions = () => {

    const formik = useFormik({
        initialValues: {
            part_of_complex: '',
            is_existing_complex: '',
            introduction: {
                existing_complex_name: '',
                residence_type: '',
                vhe_type: ''
            }
        },
        /* validationSchema: validationSchema, */
        onSubmit: (values) => {
            console.log(values)
        }
    })

    return (
        <>
            <div>
                <form onSubmit={formik.handleSubmit}>

                    {/* PART OF A COMPLEX */}
                    <FormControl component='fieldset'>
                        <FormLabel component='legend' style={{ color: 'black'}}>Is the residence part of a complex?</FormLabel>
                        <RadioGroup
                            name='part_of_complex'
                            value={formik.values.part_of_complex}
                            onChange={formik.handleChange}
                        >
                            <FormControlLabel
                                value='true'
                                control={<Radio />}
                                label='True'
                            />
                            <FormControlLabel
                                value='false'
                                control={<Radio />}
                                label='False'
                            />
                        </RadioGroup>
                    </FormControl>

                    {/* EXISTING COMPLEX */}
                    {formik.values.part_of_complex && (
                        <FormControl component='fieldset'>
                            <FormLabel component='legend' style={{ color: 'black'}}>Is the residence part of a complex?</FormLabel>
                            <RadioGroup
                                name='is_existing_complex'
                                value={formik.values.is_existing_complex}
                                onChange={formik.handleChange}
                            >
                                <FormControlLabel
                                    value='true'
                                    control={<Radio />}
                                    label='True'
                                />
                                <FormControlLabel
                                    value='false'
                                    control={<Radio />}
                                    label='False'
                                />
                            </RadioGroup>
                        </FormControl>
                    )}

                    {/* RESIDENCE TYPE */}
                    {formik.values.part_of_complex && formik.values.is_existing_complex && (
                        <FormControl fullWidth>
                            <InputLabel id='demo-simple-select-label'>Choose a complex</InputLabel>
                            <Select
                                labelId='demo-simple-select-label'
                                id='demo-simple-select'
                                value={age}
                                label='Age'
                                onChange={formik.handleChange}
                            >
                                <MenuItem value={10}>Ten</MenuItem>
                                <MenuItem value={20}>Twenty</MenuItem>
                                <MenuItem value={30}>Thirty</MenuItem>
                            </Select>
                        </FormControl>
                    )}

                    <Button color='primary' variant='contained' fullWidth type='submit'>
                        Submit
                    </Button>
                </form>
            </div>
        </>
    )
}

export default SomeQuestions
